      out.write("			formData.append(\"product_name\", $(\"#product_name\").val());\n");
      out.write("			formData.append(\"brand\", $(\"#brand\").val());\n");
      out.write("			formData.append(\"price\", $(\"#price\").val());\n");
      out.write("			formData.append(\"discount\", $(\"#discount\").val());\n");
      out.write("			formData.append(\"detail\", $(\"#detail\").val());\n");
      out.write("\n");
      out.write("			// 사이즈 데이터 쌓기\n");
      out.write("\n");
      out.write("			//for(let i = 0; i < $(\"input[name='size']\").length; i++){\n");
      out.write("			//	if($(\"input[name='size']\")[i].checked == true){\n");
      out.write("			//		formData.append(\"size\", $($(\"input[name='size']\")[i]).val());\n");
      out.write("			//	}\n");
      out.write("			//}\n");
      out.write("			let sizeCheckedArray = [];\n");
      out.write("			$.each($(\"input[name='size']:checked\"), function(){\n");
      out.write("				//$(this)는 each문 내의 현재 객체 자신을가르킴\n");
      out.write("				sizeCheckedArray.push($(this).val());\n");
      out.write("			});\n");
      out.write("			formData.append(\"size[]\", sizeCheckedArray);\n");
      out.write("\n");
      out.write("			// 색상 데이터 쌓기\n");
      out.write("			//for(let i = 0; i < $(\"input[name='color']\").length; i++){\n");
      out.write("			//	if($(\"input[name='color']\")[i].checked == true){\n");
      out.write("			//		formData.append(\"color\", $($(\"input[name='color']\")[i]).val());\n");
      out.write("			//	}\n");
      out.write("			//}\n");
      out.write("			let colorCheckedArray = [];\n");
